def most_frequent_values(lst):
    frequencies = {}
    max_freq = 1
    most_frequent_values = []
    for num in lst:
        if num in frequencies:
            frequencies[num] += 1
        else:
            frequencies[num] = 1
        if frequencies[num] > max_freq:
            max_freq = frequencies[num]
